import TileBar from "../Components/TileBar";
import Nav from "../Components/Nav";
import Layout from '../Components/Layout';
import './index.scss';

const index = () => {
  return (
    <Layout>
      <Nav current="home"/>
      <TileBar />
    </Layout>
    );

}
export default index;
